import React from 'react'
 class Main extends React.Component{
     render(){
        return (
            <div className ="Movie-names">
                <h2>{this.props.movie.name}</h2>
                <img src={this.props.movie.imgUrl}width ="500" height="00" alt ="" />
                <p>Date :{this.props.movie.date} </p>
            </div>
        )
     }
 }
 export default Main
